</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="manuel-d-utilisateur_demarrage" href="#manuel-d-utilisateur">Démarrage</a>
</h2><br>Pour ouvrir le manuel d'utilisateur:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous double-cliquons sur le manuel d'utilisateur.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous accédons au manuel d'utilisateur.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Nous accédons au sommaire du manuel d'utilisateur.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(4) Nous sélectionnons un sujet.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(5) Nous accédons à l'aide associée au sujet.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="manuel-d-utilisateur_recherche-par-index" href="#manuel-d-utilisateur">Recherche par index</a>
</h2><br>Pour réaliser une recherche par index:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous cliquons sur l'onglet (Index).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous saisissons le mot-clé à rechercher.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Nous sélectionnons le sujet.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(4) Nous cliquons sur le bouton (Afficher).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(5) Nous accédons à l'aide associée au sujet.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="manuel-d-utilisateur_recherche-par-mot" href="#manuel-d-utilisateur">Recherche par mot</a>
</h2><br>Pour rechercher un mot:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous cliquons sur l'onglet (Rechercher).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous saisissons le mot-clé à rechercher.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Nous affichons les rubriques.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(4) Nous sélectionnons une rubrique.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(5) Nous affichons la rubrique.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(6) Nous accédons à l'aide de la rubrique.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(7) Nous visualisons les mots recherchés.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
